description:
 A warm welcome back to the lovely Carrie, who like the sun gliding out from behind a cloud is always a pleasure to see again. And an even warmer welcome to a first timer by the name of Foxie. She's a very shy girl and was rather nervous on set but seeing a natural down to earth type like Carrie soon calmed her nerves. Once they started to kiss and she felt Carrie's lovely soft lips on hers it seemed like she had suddenly fallen in love and was now gazing at her somewhere between desire and awe. We know how she feels.

